import React, { Component } from 'react';
import Koockie from './cookie.jpeg'


class Cookie extends Component {
  constructor() {
    super()
    this.state = {
      clicked : 0
    }
  }
  render() {
    return (
      <div>
        <img src={Koockie} alt=""/>
      </div>
    );
  }
}

export default Cookie;
